import React, { useEffect } from 'react'

export default function Logout(props) {

    useEffect(() => {
        // localStorage.clear("signupData")
        window.localStorage.removeItem('signupData');
    }, [])

    props.history.push("/home")

    return (
        <div>
            Hello
        </div>
    )
}
